//pages/Nav.js
import React from "react";
import axios from "axios";

function eventTable() {
    let pagenum = 1;
    axios.get('http://210.115.227.82:18080/api/event/list?cnt=10&num='+pagenum)
    .then(function (response) {
        console.log(response.data.response.list[0]);
        
    })
    .catch(function (error) {
        console.log(error);
    })

  return (

    <table id = "eventTable">
        <thead>
            <tr>
                <th></th>
            </tr>
        </thead>
    </table>
  );
}

export default eventTable;
